    false,nt"url": null,nt"notes": "This annual narrative report for Rydell
    National Wildlife Refuge summarizes Refuge activities during the 2005 fiscal year.
    The report begins with an introduction to the Refuge and a summary of the yearu2019s
    highlights and climatic conditions. Information about monitoring and studies- including
    surveys and censuses- is provided next. Habitat restoration and management projects
    are also covered; activities include wetland restoration, upland restoration, water
    level management, mowing, farming, timber management, prescribed burning, and vegetation
    control. Fish and wildlife management is discussed next with emphasis on nest structures
    and animal control. Coordination activities, such as interagency coordination, tribal
    coordination, and Friends organizations, are outlined. The resource protection section
    provides updates on law enforcement and wildfire preparedness. Information about
    public education and recreation is given including visitor services and outreach.
    Finally, comprehensive management planning and general administration are discussed
    in the Refuge planning and administration section. Refuge brochures, maps, and newsletters
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
